import axios from 'axios';
import React, {useEffect} from 'react';
import {useState} from 'react';
import './VideoFilm.scss';

var test = [
    'hello',
    'votiendat',
    'hoc vien buuc hinh vien thong'
]

function VideoFilm(){
    const [listfilm, setListfilm] = useState([]);
    useEffect(()=> {
        setListfilm(test);
    },[listfilm]);
    return(
        <div className = "Film container-sm w-100">
            <video  className = "VideoFilm container-sm w-100 "width="1000" height="500"  controls>
                <source  src={"http://localhost:8081/static/videos/14141.mp4"} type="video/mp4"/>
            </video>
            <div className = "TenPhim">
                vo tien dat
            </div>
            <div className = "TapPhim">
                {
                    listfilm!=undefined && (
                        <React.Fragment>
                            {
                                listfilm.map((router,index) =>{
                                    return(
        
                                        <button key = {index} className = "col-sm-1">
                                            <a href = "/hello" className >{index}</a>
                                        </button>
                                    )
                                })
                            }
                        </React.Fragment>
                    )
                }
            </div>
        </div>
    )
}

export default VideoFilm;
